import React from "react";
import Link from "next/link";
// import PropTypes from "prop-types";

const Header = () => {
	return (
		<>
			<div>Header created.</div>
			<div>
				<Link href="/">
					<a>Home</a>
				</Link>
			</div>
			<div>
				<Link href="/about">
					<a>About</a>
				</Link>
			</div>
		</>
	);
};

// Header.propTypes = {
// };

export default Header;
